import React from 'react';
import Common from './Common';
import web from '../src/images/Business_SVG.svg';



const About = () => {
    return(
        <>
        <Common name="Welcome to About PM Developer" imgsrc={web} visit='/contact' btnname="Contact Now"/>
        </>
    )
}

export default About;
